import { Container, Divider, Stack, Typography } from '@mui/material';
import React, { useState } from 'react';
import Sample from './Assests/AssestPhotoSample.jpg'

// import '@fontsource/inter/300.css';
// import '@fontsource/inter/400.css';
// import '@fontsource/inter/500.css';
// import '@fontsource/inter/700.css';

import { CustomLink, Assest } from './Components/Components';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Routes
} from "react-router-dom";

function App() {
  return (
    <Container fixed>
      <Typography m="10px" variant='h5'>Explore</Typography>
      <Router>
        <Stack direction="row" mb="10px">
          <CustomLink to="/gaming">

          </CustomLink>
          <Link>
            <Typography m="10px" variant='h6' >Art</Typography>
          </Link>
          <Link>
            <Typography m="10px" variant='h6' >Photography</Typography>
          </Link>
        </Stack>
        <Routes>
          <Route index element={<All />} />
          <Route path='/m' element={
            <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
            </Stack>
          } />
          <Route path='/#gaming' element={
            <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
            </Stack>
          } />
          <Route path='/#art' element={
            <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
            </Stack>
          } />
          <Route path='/#photography' element={
            <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
              <Assest src={Sample} name="Art name" price="0.0001ETH" />
            </Stack>
          } />

        </Routes>
      </Router>

      {/* <Stack direction="row" >
        <Typography variant='h6'>All</Typography>
        <Typography variant='h5'>Gaming</Typography>
        <Typography variant='h5'>Art</Typography>
        <Typography variant='h5'>Photography</Typography>
      </Stack>
      <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
        <Assest src={Sample} name="Art name" price="0.0001ETH" />
      </Stack> */}
    </Container>
  );
}

export default App;

function All() {
  return (
    <Stack direction="row" useFlexGap flexWrap="wrap" spacing={2}>
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
      <Assest src={Sample} name="Art name" price="0.0001ETH" />
    </Stack>
  )
}
